import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import 'react-datepicker/dist/react-datepicker.css';
import './App.css';
import TravelDate from "./components/js/TravelDate";
import TravelDetails from "./components/js/TravelDetails";
import Login from "./components/js/Login";
import SignUp from "./components/js/SignUp";

function App() {
    return (
        <Router>
            <div className="App">
             <div className="auth-links">
                    <Link to="/login">로그인</Link> | <Link to="/signup">회원가입</Link>
             </div>
                <h1>YOUR PLANNER</h1>
                <h4>유플과 시작하는 여행 !</h4>

                <Routes>
                    <Route path="/" element={<TravelDate />} />
                    <Route path="/details" element={<TravelDetails />} />
                    <Route path="/login" element={<Login />} />
                    <Route path="/signup" element={<SignUp />} />
                </Routes>
            </div>
        </Router>
    );
}
const hasSession = sessionStorage.getItem('user') !== null;

if (hasSession) {
    console.log('세션에 사용자 정보가 있습니다.');
} else {
    console.log('세션에 사용자 정보가 없습니다.');
}

export default App;
